// Home.jsx
import React from "react";
// Components
import NavbarDate from "../components/NavbarDate/NavbarDate";
import MovieTrending from "../components/MoviesSlider/MovieTrending";
import MoviePopular from "../components/MoviesSlider/MoviePopular";
import MovieUpcoming from "../components/MoviesSlider/MovieUpcoming";
import SearchMovie from "../components/SearchMovie";
// Utils
import ButtonUp from "../utils/ButtonUp";

const Home = () => {
    return (
        <main
            id="home"
            className="bg-site min-h-screen bg-cover overflow-hidden"
        >
            <NavbarDate />
            <div className="container mx-auto mt-40">
                <div className="text-center items-center mb-5">
                    <h2 className="hover:scale-125 font-primary text-accent text-[32px] tracking-[10%] uppercase text-center mt-16">
                        Nonton Film Gratis
                    </h2>
                    <h3 className="font-primary font-semibold text-[26px] leading-[46px] text-center mb-5">
                        Tanpa Karcis
                    </h3>
                </div>
            </div>
            <SearchMovie />
            <MovieUpcoming />
            <MovieTrending />
            <MoviePopular />
            <ButtonUp />
        </main>
    );
};

export default Home;
